//CIREDESIGN// is a Los Angeles based entertainment design studio. Our area of focus is concept design/art direction consulting that has included work for AICP, Layton Polard, Giant Bomb, and Squidbeans to name just a few. In recent years we have given presentations for dozens of well known outlets and organizations including: AAAA, VentureBeat, GameSpot, Vice, Electronic Arts, Ubisoft, & Criterion. We also deliver the design trainings for interns for Gears of War, Halo 3, and Mass Effect 2.

Patrick Markey, MyArtFeet lead artist & lead developer

Previously, Patrick collaborated on the Crash Bandicoot and Jak II art trainings for the AAAA Critical Artistry Network and Scribbles & Paint (a 2 year program for students to expand their digital arts skills), the Pixar School of Art underpass two years before, and the Los Angeles born and raised Angie's List illustrator

